import './Search.css';
import { useState } from 'react'
import { useEffect } from 'react';



const Search = () => {
    const [lat, setLat] = useState(null)
    const [lon, setLon] = useState(null)


    return (
        <div className='Search_div_container'>
            <form className='Search_form'>
                <input className='Search_input' id='Search_lat_input' type='number'placeholder='Latitude'  value={lat}></input>
                <input className='Search_input' id='Search_lon_input' placeholder='Longitude' type='number' value={lat}></input>
                <button className='Search_button' type='submit' value='submit'>Search</button>
            </form>
        </div>
    )
}

export default Search
